import React from 'react';
import './AccommodationForm.less';
import {
  Form, Radio, Button, Input,
} from 'antd';
import { CloseOutlined } from '@ant-design/icons';
import { ReactComponent as RoomIcon } from '../../../icons/room.svg';
import MetroSelect from '../../../common/Filters/MetroSelect/MetroSelect';

const AccommodationForm = (): JSX.Element => {
  const onFinish = (values: any) => {
    console.log(values);
  };
  return (
    <div className="form">
      <div className="form-title">
        Мое объявление
      </div>
      <Form
        initialValues={{}}
        onFinish={onFinish}
      >
        <Form.Item label="Что сдаете?" name="roomType">
          <div className="form-room">
            <Radio.Group>
              <Radio.Button value="room">
                <div className="room-icon">
                  <RoomIcon />
                </div>
                <div className="room-title">
                  Комнату
                </div>
              </Radio.Button>
              <Radio.Button value="flat">
                <div className="room-icon flat">
                  <RoomIcon />
                </div>
                <div className="room-title">
                  Квартиру
                </div>
              </Radio.Button>
            </Radio.Group>
          </div>
        </Form.Item>
        <Form.List name="metro">
          {(fields, { add, remove }) => (
            <>
              {fields.map(({ key, name, fieldKey }) => (
                <div className="metro-fields" key={key}>
                  <Form.Item
                    name={[name, 'metro']}
                    fieldKey={[fieldKey, 'metro']}
                    rules={[{ required: true, message: 'Missing metro' }]}
                  >
                    <div className="metro-select">
                      <MetroSelect />
                    </div>
                  </Form.Item>
                  <Form.Item
                    name={[name, 'transportTime']}
                    fieldKey={[fieldKey, 'transportTime']}
                    rules={[{ required: true, message: 'Missing transport time' }]}
                  >
                    <Input />
                  </Form.Item>
                  <Form.Item
                    name={[name, 'transportType']}
                    fieldKey={[fieldKey, 'transportType']}
                    rules={[{ required: true, message: 'Missing transport type' }]}
                  >
                    <Radio.Group>
                      <Radio.Button value="Пешком">
                        Пешком
                      </Radio.Button>
                      <Radio.Button value="Транспортом">
                        Транспортом
                      </Radio.Button>
                    </Radio.Group>
                  </Form.Item>
                  <CloseOutlined onClick={() => remove(name)} />
                </div>
              ))}
              <Form.Item>
                <Button onClick={() => add()}>
                  Добавить станцию
                </Button>
              </Form.Item>
            </>
          )}
        </Form.List>
        <Form.Item>
          <div className="button-wrapper">
            <Button htmlType="submit">
              Разместить объявление
            </Button>
          </div>
        </Form.Item>
      </Form>
    </div>
  );
};
export default AccommodationForm;
